export default () => (
  // <!-- Category Model Start-->
  <div
    id="category_model"
    className="header-cate-model main-gambo-model modal fade"
    tabIndex="-1"
    role="dialog"
    aria-modal="false"
  >
    <div className="modal-dialog category-area" role="document">
      <div className="category-area-inner">
        <div className="modal-header">
          <button
            type="button"
            className="close btn-close"
            data-dismiss="modal"
            aria-label="Close"
          >
            <i className="uil uil-multiply"></i>
          </button>
        </div>
        <div className="category-model-content modal-content">
          <div className="cate-header">
            <h4>Select Category</h4>
          </div>
          <ul className="category-by-cat">
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-1.svg" alt="" />
                </div>
                <div className="text"> Fruits and Vegetables </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-2.svg" alt="" />
                </div>
                <div className="text"> Grocery & Staples </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-3.svg" alt="" />
                </div>
                <div className="text"> Dairy & Eggs </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-4.svg" alt="" />
                </div>
                <div className="text"> Beverages </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-5.svg" alt="" />
                </div>
                <div className="text"> Snacks </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-6.svg" alt="" />
                </div>
                <div className="text"> Home Care </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-7.svg" alt="" />
                </div>
                <div className="text"> Noodles & Sauces </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-8.svg" alt="" />
                </div>
                <div className="text"> Personal Care </div>
              </a>
            </li>
            <li>
              <a href="#" className="single-cat-item">
                <div className="icon">
                  <img src="images/category/icon-9.svg" alt="" />
                </div>
                <div className="text"> Pet Care </div>
              </a>
            </li>
          </ul>
          <a href="#" className="morecate-btn">
            <i className="uil uil-apps"></i>More Categories
          </a>
        </div>
      </div>
    </div>
    <style jsx>{`
      .main-gambo-model {
        background-image: -webkit-linear-gradient(
          left,
          rgba(230, 92, 91, 0.9),
          rgba(245, 93, 44, 0.9)
        );
        background-image: linear-gradient(
          to right,
          rgba(230, 92, 91, 0.9),
          rgba(245, 93, 44, 0.9)
        );
      }

      .category-area-inner .modal-header {
        border-bottom: 0;
      }

      .category-area-inner .btn-close {
        color: #fff !important;
        opacity: 1 !important;
        padding: 30px 0 15px !important;
        font-size: 30px !important;
        cursor: pointer !important;
      }

      .category-model-content {
        background: #fff;
        border: 0 !important;
        border-radius: 0 !important;
      }

      .catey__icon {
        display: none;
      }

      .search__icon {
        display: none;
      }

      .sub-header-icons-list {
        display: inline-block;
        font-size: 20px;
      }

      .cate__btn {
        font-size: 20px;
        color: #8f91ac !important;
        padding: 20px 20px 19px;
      }

      .cate__btn:hover {
        color: #f55d2c !important;
      }

      .search__btn {
        font-size: 20px;
        color: #fff !important;
        padding: 20px 20px 21px;
        background: #2b2f4c;
      }

      /* --- Category Mode --- */

      .cate-header {
        background: #2b2f4c;
        color: #fff;
        padding: 15px 20px;
      }

      .cate-header h4 {
